import React from "react";
import ReactDOM from "react-dom";


const fname = "Prateek";
const lname = "Priyesh";
const img = "https://picsum.photos/200/300";


ReactDOM.render( <>
<h1 contentEditable>{`My name is ${fname} ${lname}`}</h1>
<img src = {img} alt="random img"/>
</>, document.getElementById('root'));
